contracts/cal.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Calculator {
    uint a;
    uint b;
    function add() public view returns (uint ans) {
        ans= a + b;
        return ans;
    }

    // Function to subtract one integer from another
    function subtract() public view returns (uint ans) {
       ans=  a - b;
        return ans;
    }

    // Function to multiply two integers
    function multiply() public view returns (uint ans) {
        ans=a*b;
        return ans;
    }

    // Function to divide one integer by another
    function divide() public view returns (uint ans) {
        require(b != 0, "Division by zero is not allowed");
        ans=a/b;
        return ans;
    }
}

